import React from 'react';
import Header from '../components/Header';
import Image from '../images/img-1.jpg';

function Home() {
    return (
        <>
            <Header /> 
            <Hero image={Image} title='Experience Nature' desc='Once in a lifetime' />
        </>
    );
}

export default Home;
